import React from 'react'
import './FAQs.css'
import ques from './FAQ_data'

const Content = () => {
  return (
    <div className='container' id='content2'>
      {ques.map(que => {
        return (
          <h2>{que.q}</h2>
        // <p>{que.a}</p>
        )

      })}
    </div>
  )
}

export default Content
